import React, { useState } from 'react';
import './CropPrediction.css';
import wheatImage from '../../Assets/Images/wheat.jpg';
const CropPrediction = () => {
    const [formData, setFormData] = useState({
        nitrogen: '',
        phosphorus: '',
        potassium: '',
        temperature: '',
        humidity: '',
        ph: '',
        rainfall: '',
        location: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Submitted Data:', formData);

        // Simulate an API call or database update
        alert('Crop Prediction data submitted successfully!');
    };

    return (
        <div className="container">
            <div className="main-container">
                <div className="left-section">
                    <div className="header">
                        <div className="text">Crop Prediction</div>
                        <div className="underline"></div>
                    </div>
                    <form className="inputs" onSubmit={handleSubmit}>
                        {Object.keys(formData).map((key) => (
                            <div key={key} className="input">
                                <input
                                    type="text"
                                    placeholder={key.charAt(0).toUpperCase() + key.slice(1)}
                                    name={key}
                                    value={formData[key]}
                                    onChange={handleChange}
                                    required
                                />
                            </div>
                        ))}
                        <div className="submit-container">
                            <button type="submit" className="submit">
                                Predict Crop
                            </button>
                        </div>
                    </form>
                </div>
                <div className="right-panel">
                    <img
                        src="https://images.unsplash.com/photo-1581464777441-d251a26d69e9?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwzNjI5OXwwfDF8c2VhY2h8Mnx8d3JpdGV8ZW58MHx8fHwxNjcyMjQ0Nzgx&ixlib=rb-1.2.1&q=80&w=1080" 
                        alt="Wheat Background"
                        className="background-image"
                    />
                </div>
            </div>
        </div>
    );
};

export default CropPrediction;
